import React from "react";

const Table = () => {
  return (
    <div style={{ height: "727px", width: "100%", border: "2px solid black" }}>
      <div className="container mb-5">
        <table
          class="table caption-top"
          style={{
            border: "1px solid black",
            fontSize: "38px",
          }}
        >
          <tbody>
            <tr style={{ padding: "22.8px 15px" }}>
              <th style={{ padding: "22.8px 15px" }} scope="row">
                Current
              </th>
              <td style={{ padding: "22.8px 15px" }}>Metafy</td>
              <td style={{ padding: "22.8px 15px" }}>Design Lead</td>
              <td style={{ padding: "22.8px 15px" }}>Remote</td>
              <th style={{ padding: "22.8px 15px" }}>+</th>
            </tr>
            <tr id="row1" class="" style={{ padding: "22.8px 15px" }}>
              <td colspan="2">Collapsible content for Row 1</td>
            </tr>
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Table;
